import React, { useState, useEffect } from 'react';
import axios from 'axios';

const OpenComplaints = () => {
  const [complaints, setComplaints] = useState([]);

  useEffect(() => {
    axios
      .get('http://localhost:5000/complaints/open')
      .then((response) => {
        setComplaints(response.data.complaints);
      })
      .catch((error) => {
        console.error('Error fetching open complaints:', error);
      });
  }, []);

  return (
    <div>
      <h1>Açık Arızalar</h1>
      <table>
        <thead>
          <tr>
            <th>Arıza No</th>
            <th>Başlık</th>
            <th>Kaydı Oluşturan Kullanıcı</th>
            <th>Statü</th>
            <th>Detayları Gör</th>
          </tr>
        </thead>
        <tbody>
          {complaints.map((complaint) => (
            <tr key={complaint.id}>
              <td>{complaint.id}</td>
              <td>{complaint.title}</td>
              <td>{complaint.created_by}</td>
              <td>{complaint.status}</td>
              <td>
                <Link to={`/complaint/${complaint.id}`}>Detayları Gör</Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default OpenComplaints;
